import React from 'react'
import './Operator.scss'

class Operator extends React.Component {
    render() {
        let operators = [ '+', '-', 'x', 'รท', '=', '.'];
        return (
           operators.map((operator) => {
            return(
                <button class={`button-${operator} operator`}>
                    {operator}
                </button>
            )
           })
        )
    }
}

export default Operator
